import service from '@/utils/service'
export default {
  name: 'mypage',
  components: {
    navHeader
  },
  props: {},
  data () {
    return {}
  },
  computed: {
    myUser () {
      return this.$store.state.currentUser
    }
  },
  async created () {
    let resp = await service.get('users/userinfo', {
      userId: this.$store.state.currentUser._id
    })

    if (resp.code === 0 && !this.myUser.avatar) {
      this.myUser = resp.data
    }
  },
  mounted () {
    let self = this
    weui.uploader('#uploaderMyAvatar', {
      url: service.baseURL + 'post/uploadimgaliyun',
      auto: true,
      type: 'file',
      fileVal: 'image',
      compress: {
        width: 1300,
        height: 1300,
        quality: 0.8
      },
      onBeforeQueued: function (files) {
        // `this` 是轮询到的文件, `files` 是所有文件

        if (
          ['image/jpg', 'image/jpeg', 'image/png', 'image/gif'].indexOf(
            this.type
          ) < 0
        ) {
          weui.alert('请上传图片')
          return false // 阻止文件添加
        }
        if (this.size > 10 * 1024 * 1024) {
          weui.alert('请上传不超过10M的图片')
          return false
        }
      },

      onBeforeSend: function (data, headers) {
        // console.log(this, data, headers);
        // $.extend(data, { test: 1 }); // 可以扩展此对象来控制上传参数
        // $.extend(headers, { Origin: 'http://127.0.0.1' }); // 可以扩展此对象来控制上传头部
        headers['wec-access-token'] = getCookie('token')
        // return false; // 阻止文件上传
      },
      onSuccess: function (ret) {
        self.changeAvatarCallback(ret)
        // return true; // 阻止默认行为，不使用默认的成功态
      }
    })
  },

  methods: {
    /*
    * 修改头像
    */
    async changeAvatarCallback (obj) {
      // console.log(obj)
      let resp = await service.post('users/update', {
        userId: this.myUser._id,
        avatar: obj.data.url
      })

      if (resp.code === 0) {
        // 修改成功之后要通知vuex来更新store的数据
        this.$store.dispatch('setUser', {
          ...this.myUser,
          avatar: obj.data.url
        })

        weui.toast('修改成功', 1000)
      }
    },
    changeAvatar () {
      this.$refs.uploaderInputAvatar.click()
    },
    /*
    * 修改性别
    */
    async changeGender (gender) {
      let resp = await service.post('users/update', {
        userId: this.myUser._id,
        gender: gender
      })
      // 修改成功之后要通知vuex来更新store的数据
      if (resp.code === 0) {
        this.$store.dispatch('setUser', {
          ...this.myUser,
          gender: gender
        })
        weui.toast('修改成功', 1000)
      }
    },
    goChangeGender () {
      weui.actionSheet(
        [
          {
            label: '男',
            onClick: () => {
              this.changeGender(1)
              // console.log('拍照');
            }
          },
          {
            label: '女',
            onClick: () => {
              this.changeGender(0)
              // console.log('拍照');
            }
          }
        ],
        [
          {
            label: '取消',
            onClick: function () {
              // console.log('取消');
            }
          }
        ]
      )
    },
    goChangeName () {
      this.$router.push({
        name: 'changenickname',
        params: {
          name: this.myUser.nickname
        }
      })
    },
    goChangeDesc () {
      this.$router.push({
        name: 'changedesc',
        params: {
          desc: this.myUser.desc
        }
      })
    },

    goChat () {
      this.$router.push({
        name: 'chatlist',
        params: {}
      })
    }
  }
}
